import React from 'react';
import styled from 'styled-components';

const LogoContainer = styled.div`
  display: flex;
  align-items: center;
  gap: ${props => props.theme.spacing.sm};
  cursor: pointer;
  transition: ${props => props.theme.transitions.base};

  &:hover {
    transform: scale(1.05);
  }
`;

const LogoIcon = styled.div`
  width: ${props => props.size === 'large' ? '48px' : props.size === 'medium' ? '36px' : '28px'};
  height: ${props => props.size === 'large' ? '48px' : props.size === 'medium' ? '36px' : '28px'};
  position: relative;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const LogoText = styled.span`
  font-family: ${props => props.theme.fonts.primary};
  font-weight: ${props => props.theme.fontWeights.bold};
  font-size: ${props => props.size === 'large' ? props.theme.fontSizes['2xl'] : 
                        props.size === 'medium' ? props.theme.fontSizes.xl : 
                        props.theme.fontSizes.lg};
  background: ${props => props.theme.colors.gradientPrimary};
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  background-clip: text;
  letter-spacing: -0.02em;
`;

const LokanexLogo = ({ size = 'medium', showText = true, ...props }) => {
  return (
    <LogoContainer {...props}>
      <LogoIcon size={size}>
        <svg
          width="100%"
          height="100%"
          viewBox="0 0 100 100"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
        >
          {/* Central hexagon */}
          <polygon
            points="50,15 75,30 75,70 50,85 25,70 25,30"
            fill="url(#hexGradient)"
            stroke="url(#hexStroke)"
            strokeWidth="1"
          />

          {/* Inner circle */}
          <circle
            cx="50"
            cy="50"
            r="20"
            fill="url(#innerGradient)"
            stroke="url(#innerStroke)"
            strokeWidth="1"
          />

          {/* Floating elements around hexagon */}
          <circle cx="50" cy="5" r="3" fill="url(#accent1)" />
          <circle cx="85" cy="50" r="3" fill="url(#accent2)" />
          <circle cx="50" cy="95" r="3" fill="url(#accent3)" />
          <circle cx="15" cy="50" r="3" fill="url(#accent4)" />

          {/* Connection lines */}
          <line x1="50" y1="5" x2="50" y2="15" stroke="url(#line1)" strokeWidth="1.5" opacity="0.6" />
          <line x1="85" y1="50" x2="75" y2="50" stroke="url(#line2)" strokeWidth="1.5" opacity="0.6" />
          <line x1="50" y1="95" x2="50" y2="85" stroke="url(#line3)" strokeWidth="1.5" opacity="0.6" />
          <line x1="15" y1="50" x2="25" y2="50" stroke="url(#line4)" strokeWidth="1.5" opacity="0.6" />

          {/* Central dot */}
          <circle cx="50" cy="50" r="4" fill="url(#centerDot)" />

          {/* Gradients */}
          <defs>
            <linearGradient id="hexGradient" x1="0%" y1="0%" x2="100%" y2="100%">
              <stop offset="0%" stopColor="#00d4ff" />
              <stop offset="50%" stopColor="#4ecdc4" />
              <stop offset="100%" stopColor="#0099cc" />
            </linearGradient>
            <linearGradient id="hexStroke" x1="0%" y1="0%" x2="100%" y2="100%">
              <stop offset="0%" stopColor="#ffffff" />
              <stop offset="100%" stopColor="#e0e0e0" />
            </linearGradient>
            <radialGradient id="innerGradient" cx="50%" cy="50%" r="50%">
              <stop offset="0%" stopColor="#ffffff" stopOpacity="0.8" />
              <stop offset="70%" stopColor="#00d4ff" stopOpacity="0.3" />
              <stop offset="100%" stopColor="#4ecdc4" stopOpacity="0.1" />
            </radialGradient>
            <linearGradient id="innerStroke" x1="0%" y1="0%" x2="100%" y2="100%">
              <stop offset="0%" stopColor="#00d4ff" />
              <stop offset="100%" stopColor="#4ecdc4" />
            </linearGradient>
            <radialGradient id="accent1" cx="50%" cy="50%" r="50%">
              <stop offset="0%" stopColor="#ff6b35" />
              <stop offset="100%" stopColor="#ff8c42" />
            </radialGradient>
            <radialGradient id="accent2" cx="50%" cy="50%" r="50%">
              <stop offset="0%" stopColor="#4ecdc4" />
              <stop offset="100%" stopColor="#44a08d" />
            </radialGradient>
            <radialGradient id="accent3" cx="50%" cy="50%" r="50%">
              <stop offset="0%" stopColor="#00d4ff" />
              <stop offset="100%" stopColor="#0099cc" />
            </radialGradient>
            <radialGradient id="accent4" cx="50%" cy="50%" r="50%">
              <stop offset="0%" stopColor="#ff6b35" />
              <stop offset="100%" stopColor="#ff8c42" />
            </radialGradient>
            <linearGradient id="line1" x1="0%" y1="0%" x2="0%" y2="100%">
              <stop offset="0%" stopColor="#ff6b35" />
              <stop offset="100%" stopColor="#00d4ff" />
            </linearGradient>
            <linearGradient id="line2" x1="0%" y1="0%" x2="100%" y2="0%">
              <stop offset="0%" stopColor="#4ecdc4" />
              <stop offset="100%" stopColor="#00d4ff" />
            </linearGradient>
            <linearGradient id="line3" x1="0%" y1="100%" x2="0%" y2="0%">
              <stop offset="0%" stopColor="#00d4ff" />
              <stop offset="100%" stopColor="#ff6b35" />
            </linearGradient>
            <linearGradient id="line4" x1="100%" y1="0%" x2="0%" y2="0%">
              <stop offset="0%" stopColor="#ff6b35" />
              <stop offset="100%" stopColor="#4ecdc4" />
            </linearGradient>
            <radialGradient id="centerDot" cx="50%" cy="50%" r="50%">
              <stop offset="0%" stopColor="#ffffff" />
              <stop offset="100%" stopColor="#00d4ff" />
            </radialGradient>
          </defs>
        </svg>
      </LogoIcon>
      {showText && <LogoText size={size}>Lokanex</LogoText>}
    </LogoContainer>
  );
};

export default LokanexLogo;
